import React from 'react';
import './Email.css';

const Email = () => {
    return (
        <div className="outer-email-container">
            <div className="inner-email-container">
            <a id="email" href="mailto:zoe.a.h.davidson@gmail.com">zoe.a.h.davidson@gmail.com</a>
            </div>
        </div>
    )
}

export default Email;
